export function getUsers(){
  const options = {
    method: "GET",
    headers: {
      "Authorization": "Basic YWRtaW46YWRtaW4=",
      "Content-Type": "application/json",
    },
  }

  fetch("http://localhost:8080/usuarios/todos-os-usuarios", options)
  .then(response => response.json())
  .then(responseJson => returnJson(responseJson));

  function returnJson(data){
    return data;
  }
}
